INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (4, 10021, 4, 24, "2019/07/31 12:00:00", "2030/12/17 14:59:59", "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 0.0, "カオリ（サマー）", 1, 24015, 110501, 0.0, 0.0);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (1, 10021, 4, 24, "2019/07/31 12:00:00", "2030/12/17 14:59:59", "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 0.0, "カオリ（サマー）", 2, 24016, 110501, 0.0, 4.0);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (4, 10021, 4, 24, "2019/07/31 12:00:00", "2030/12/17 14:59:59", "マジムンだらけで目が回るさ～！\nふらふらさ～！", 0.0, "カオリ（サマー）", 3, 24017, 110501, 0.0, 0.0);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (2, 10021, 1, 24, "2019/07/31 12:00:00", "2030/12/17 14:59:59", "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 0.0, "カオリ（サマー）", 4, 24018, 110501, 0.0, 5.2);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (6, 10021, 5, 24, "2019/07/31 12:00:00", "2030/12/17 14:59:59", "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 0.0, "カオリ（サマー）", 5, 24019, 110501, 0.0, 4.2);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (2, 10021, 2, 24, "2019/07/31 12:00:00", "2030/12/17 14:59:59", "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 0.0, "カオリ（サマー）", 6, 24020, 110501, 0.0, 0.0);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (6, 10021, 1, 24, "2019/07/31 12:00:00", "2030/12/17 14:59:59", "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 0.0, "カオリ（サマー）", 7, 24021, 110501, 0.0, 6.4);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (2, 10021, 2, 24, "2019/07/31 12:00:00", "2030/12/17 14:59:59", "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 0.0, "カオリ（サマー）", 8, 24022, 110501, 0.0, 0.0);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (3, 10021, 6, 24, "2019/07/31 12:00:00", "2030/12/17 14:59:59", "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 0.0, "カオリ（サマー）", 9, 24023, 110501, 0.0, 10.08);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (2, 10021, 1, 24, "2019/07/31 12:00:00", "2030/12/17 14:59:59", "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 0.0, "カオリ（サマー）", 10, 24024, 110501, 0.0, 5.0);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (2, 10021, 2, 24, "2019/07/31 12:00:00", "2030/12/17 14:59:59", "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 0.0, "カオリ（サマー）", 11, 24025, 110501, 0.0, 0.0);
